import './App.css';
import Table from 'react-bootstrap/Table';

function App() {
  return(
    <>
    <div className="text-center">
    <h1>Task Manager</h1>
    <button>add</button>
    <Table>
      <Thead>
        <Tr>
          <Th>S.No</Th>
          <Th>Name</Th>
          <Th>Date</Th>
          <Th>Action</Th>
        </Tr>
      </Thead>
    </Table>
    </div>
    </>
);
}

export default App;
